import React from "react";

const Banner = () => {
  return (
    <div>
      <header id="banner">
        <button type="button" className="back">
          &lt; 뒤로
        </button>
        <h1 className="title">나에게 어울리는 단과대학은?</h1>
        <p className="count"></p>
        <div className="gauge"></div>
      </header>
    </div>
  );
};

export default Banner;
